import React from "react";
import "./Rules.css";

function Gallery() {
  return (
    <div style={{ padding: "20px" }}>
      <h1>Galleri</h1>
      <p>Här visas våra senaste Instagram-inlägg.</p>

      <div className="rules-container" style={{ display: "flex", flexWrap: "wrap", gap: "20px" }}>
        {/* Embed plats för upp till 10 inlägg */}
        <div style={{ flex: "1 1 300px", minWidth: "300px" }}>
          {/* Instagram embed 1 */}
          <blockquote className="instagram-media" data-instgrm-permalink="https://www.instagram.com/p/COFbU-LIGy0/" data-instgrm-version="14"></blockquote>
        </div>
        <div style={{ flex: "1 1 300px", minWidth: "300px" }}>
          {/* Instagram embed 2 */}
          <blockquote className="instagram-media" data-instgrm-permalink="https://www.instagram.com/p//CIswcMtIFeT/" data-instgrm-version="14"></blockquote>
        </div>
        <div style={{ flex: "1 1 300px", minWidth: "300px" }}>
          {/* Instagram embed 3 */}
          <blockquote className="instagram-media" data-instgrm-permalink="https://www.instagram.com/p/CIdC_XvI1fb/" data-instgrm-version="14"></blockquote>
        </div>
        {/* ... fortsätt upp till 10 */}
      </div>

      {/* Instagram script */}
      <script async src="//www.instagram.com/embed.js"></script>
    </div>
  );
}

export default Gallery;
